import requestsimport csvdef get_html(url):    r = requests.get(url)    return r.textdef write_csv(data):    with open('websutes.scv', 'a') as f:        order = ['name', 'url', 'discription', 'traffic', 'percent']        writer = csv.DictWriter(f, fieldnames = order)        writer.writerow(data)def main():    for i in range(0, 5911+1):        url = 'https://www.liveinternet.ru/rating/ru//today.tsv?page={}'.format(i)        response = get_html(url)        data = response.strip().split('\n')[1:]        print(f'{i} is done')        for row in data:            colums = row.split('\t')            name = colums[0]            url = colums[1]            discription = colums[2]            traffic = colums[3]            percent = colums[4]            data = {'name': name,                    'url': url,                    'discription': discription,                    'traffic': traffic,                    'percent': percent                }            write_csv(data)if __name__ == '__main__':    main()